import Draggable from 'react-draggable';
import {Modal,message,Button} from 'antd';
import {LoginWrapper,LoginLeft,LoginRight} from './style';

function ThemeLogin(){

    // JSX
    const defaultWrapperContent = (
        <LoginWrapper>
            <LoginLeft>
                <div className='login-content'>
                    <div className='login-bg'></div>
                    <Button
                        type='ghost'
                        shape="round"
                    >
                        手机号登录
                    </Button>
                    <Button
                        type='ghost'
                    >
                        注册
                    </Button>

                </div>
            </LoginLeft>
            <LoginRight></LoginRight>
        </LoginWrapper>
    );


    return (
        <div>
            <Modal
                centered={true}
                footer={null}
                visible={true}
            >
                {defaultWrapperContent}
            </Modal>
        </div>
    );
}

export default ThemeLogin;
